          {
            "title": "Increase Financial Transparency",
            "description": "Ensure donors have clear visibility into how their contributions are used, promoting transparency and trust."
          },
          {
            "title": "Strengthen Church Partnerships",
            "description": "Build capacity among local churches to better serve children in their communities and deliver impactful programs."
          }
