        "missionStatement": "AACC is committed to assisting Christian counselors, the entire “community of care,” licensed professionals, pastors, and lay church members with little or no formal training. It is our intention to equip clinical, pastoral, and lay care-givers with biblical truth and psychosocial insights that minister to hurting persons and help them move to personal wholeness, interpersonal competence, mental stability, and spiritual maturity.",
        "visionStatement": "The vision of AACC has two critical dimensions. First, we want to serve the worldwide Christian church by helping it become more mature in Christ, while taking on His heart of love and sacrificial care. Secondly, we want to be serving, educating, and equipping 80,000 professional clinicians, pastoral counselors, and lay helpers in the near future.",
