        "excerpt": "Two doors down from me is a family that I have been inviting to church for more than 10 years.  Bless Every Home has caused me to intensify my prayers for this family. Saturday night before Easter, our doorbell rang at 10 p.m. It was my neighbor, asking, “When are your church services tomorrow?” We were delighted to tell him. As we arrived for Easter service, their car followed us into the parking lot. They were warmly greeted at the welcome center and the Pastor’s wife was able to connect their teenage daughter with others her age.",
